import React from "react";
import {Link} from 'react-router-dom'
const Nav =()=>{
    return(
        <div className="main-menu">
            <ul>
            <li>
                <Link to="/">Portfolio</Link>
                </li>
                <li>
                <Link to="/about">About</Link>
                </li>
                <li>
                <Link to="/conatct">Contact Us</Link>
                </li>
            </ul>
        </div>
    )
}
export default Nav;
